DROP TABLE IF EXISTS casos;
DROP TABLE IF EXISTS municipio;
DROP TABLE IF EXISTS departamento;

CREATE TABLE departamento (
	id INT NOT NULL AUTO_INCREMENT,
	nombre VARCHAR(100) NOT NULL DEFAULT '',
	codigo INT NOT NULL,
	PRIMARY KEY (id)
)
;

CREATE TABLE municipio (
	id INT NOT NULL AUTO_INCREMENT,
	departamento_id INT NOT NULL DEFAULT 0,
	nombre VARCHAR(100) NOT NULL DEFAULT '',
	codigo VARCHAR(5) NOT NULL DEFAULT '',
	PRIMARY KEY (id),
	CONSTRAINT FK_departamento_id FOREIGN KEY (departamento_id) REFERENCES departamento (id) ON UPDATE CASCADE
)
;


CREATE TABLE casos (
	id INT NOT NULL AUTO_INCREMENT,
	municipio_id INT NOT NULL,
	fecha_reporte_web DATE NOT NULL,
	fecha_notificacion DATE NOT NULL,
	edad INT NOT NULL DEFAULT 0,
	sexo VARCHAR(1) NOT NULL,
	tipo_contagio VARCHAR(50) NOT NULL,
	ubicacion VARCHAR(50) NOT NULL,
	estado VARCHAR(50) NOT NULL,
	pais_importado VARCHAR(50) NULL DEFAULT NULL,
	recuperado VARCHAR(50) NOT NULL,
	fecha_inicio_sintomas DATE  NULL,
	fecha_diagnostico DATE  NULL,
	fecha_recuperacion DATE  DEFAULT NULL,
	fecha_muerte DATE NULL DEFAULT NULL,
	PRIMARY KEY (id)
)
;

ALTER TABLE casos
	ALTER fecha_diagnostico DROP DEFAULT;

ALTER TABLE casos
	ALTER fecha_inicio_sintomas DROP DEFAULT;






